import * as S from "../HomeScreen/index.styles";
const SecondScreen = () => {
  return (
    <div>
      <S.ButtonContainer>
        <h2>Second Screen</h2>
        <S.PrimaryThemeButton>Dark Theme</S.PrimaryThemeButton>
        <S.SecondaryThemeButton>Light Theme</S.SecondaryThemeButton>
      </S.ButtonContainer>
    </div>
  );
};

export default SecondScreen;
